import React from 'react';
import { BrowserRouter as router, useHistory } from 'react-router-dom';

// import './App.css';


function About() {
    const history = useHistory();
    const test = () => {
      history.push('/');
    };  
  return (
    <router>
    <div className >
      <button onCLick = {test}>
          About
      </button>
    </div>
    </router>
  );
}

export default About;
